import React from 'react';
import ManagerProducts from './container/ManagerProducts/index';

const routes = [
  {
    title: "Home",
    path: "/",
    exact: true,
    main: () => <h2>HOME</h2>,
  },
  {
    title: "Manager",
    path: "/manager",
    main: () => <ManagerProducts/>,
  },
  {
    title: "Contact",
    path: "/contact",
    main: () => <h2>CONTACT</h2>,
  },
];
export default routes;
